import React from "react";
import { data } from "../../utils/data";
import Price from "../Price/Price";
import styles from "../Card/Card.module.css";

function Card({data}) {

    return (
        <li>
            <img className={styles.image} src={data.image} />
                <Price>{data.price}</Price>
                <p>{data.name}</p>
        </li>
    )
}

export default Card;
